import React from 'react';

const Mode = () => {
    const myStyle = {
        color: "white",
        backgroundColor: "DodgerBlue",
        padding: "10px",
        fontFamily: "Sans-Serif"
      };
  return(
  <>
<div style={myStyle}>
<h3>
    hello dark mode
</h3>
</div>
  </>
  );
};

export default Mode;
